import initialState from './initialState'
import { CLICK } from "./action";
import { action } from 'redux';

const reducer = (state = initialState ) => {
    switch(action.type) {
        case CLICK:
            return {
                ...state,
                click: state.click + 1
            }
        default:
            return state;
    }
};

export default reducer
